import React, { Component } from 'react'
import { ContentDiv, Content } from '../styles/SideBarStyles'

export class TodoStacks extends Component {
    // createStack = (name) => {
    //     return <Content key={name.key}>{name.text}</Content>    
    // }
    componentDidUpdate() {
        let name = []
        let type = []
        let desc = []
        if (this.props.entries.length >= 0) {
            for (let i = 0; i <= this.props.entries.length; i += 1) {
                if (this.props.entries[i] != undefined) {
                    let loopedEntry = this.props.entries[i]
                    name.push(loopedEntry.text.name);
                    type.push(loopedEntry.text.type);
                    desc.push(loopedEntry.text.desc);
                }
            }
        }
        console.log(name)
    }
